import React, { Component } from "react";
import { Row, Col } from "antd";
import styled from "styled-components";

const MyBook = styled.div`
    width: 250px;
    height: 350px;
    background: #2e517d;
    position relative;
    left: 50%;
    top: 50%;
    transform: translate(-50%, -50%);
    perspective: 1000px;
`;

const Cover = styled.div`
  width: 210px;
  height: 100%;
  position: absolute;
  left: 40px;
  background-color: #345b8c;
  transform: rotateY(-20deg);
  transform-style: preserve-3d;
  transfrom-origin: left;
`;

export class BookSample extends Component {
  render() {
    return (
      <MyBook>
        <div
          style={{
            width: "210px",
            height: "100%",
            position: "absolute",
            left: "40px",
            backgroundColor: "#345b8c",
            transform: "rotateY(20deg)",
            transformStyle: "preserve-3d",
            transformOrigin: "left",
          }}
        />
      </MyBook>
    );
  }
}

export default BookSample;
